// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Bid.sol";
import "./ActivationRequest.sol";

contract ActivationOrder{
    enum AOSTATUS { NoFeedback, AOConfirmed, AORejected}

    address AR_Owner;
    address bid_owner;
    uint256 qte;
    AOSTATUS status;

    constructor(address _AR_Owner, address _bid_owner, uint256 _qte){
        AR_Owner = _AR_Owner;
        bid_owner = _bid_owner;
        qte = _qte;
    }
    /*----------------------*/

    function getAllAODetails() public view returns(address, address, uint256){
        return(AR_Owner, bid_owner, qte);
    }

    function setStatus(uint _status) external returns(bool){
        if (_status == 0)
            status = AOSTATUS.NoFeedback;
        else if (_status == 1)
            status = AOSTATUS.AOConfirmed;
        else if (_status == 2)
            status = AOSTATUS.AORejected;

        return true;
    }

    function getStatus() external view returns(string memory){
        if (uint(status) == 0)
            return ("Pending");
        else if(uint(status) == 1)
            return("Activation order confirmed by FSP");
        else if(uint(status) == 2)
            return ("Activation order rejected by FSP");
    }

}
